import React from 'react';
import './PaymentMethodSelection.css';

const DigitalWalletPage = () => {
  return (
    <div className="payment-container">
      <h2>Digital Wallet Payment</h2>
      <form className="payment-form">
        <input 
          type="text" 
          className="payment-input" 
          placeholder="Account Holder Name" 
        />
        <input 
          type="text" 
          className="payment-input" 
          placeholder="Digital Wallet ID" 
        />
        <input 
          type="password" 
          className="payment-input" 
          placeholder="PIN" 
        />
        <button type="submit" className="payment-submit-btn">Pay Now</button>
      </form>
    </div>
  );
};

export default DigitalWalletPage;
